import React from "react";
import { Link } from "react-router-dom";
import homeImage from "../assests/home-image.avif";

const Home = () => {
  return (
    <div className="container mt-5">
      <div className="row align-items-center">
        
        {/* Left Side - Image */}
        <div className="col-md-6 text-center">
          <img 
            src={homeImage} 
            alt="Healthy Lifestyle" 
            className="img-fluid rounded" 
            style={{ maxHeight: "400px", width: "100%", objectFit: "cover" }} 
          />
        </div>

        {/* Right Side - Content with mt-4 */}
        <div className="col-md-6 d-flex flex-column justify-content-center text-center text-md-start mt-4">
          <h1 style={{ fontWeight: "700", color: "#1976d2" }}>
            Welcome to <span style={{ color: "#00bcd4" }}>NutriFit-Hub</span>
          </h1>
          <p className="lead" style={{ color: "#555", lineHeight: "1.8" }}>
            Your one-stop platform for personalized <strong style={{ color: "#1976d2" }}>health tips</strong>, expert
            <strong style={{ color: "#1976d2" }}> diet plans</strong>, and
            <strong style={{ color: "#1976d2" }}> fitness routines</strong>. Stay fit, eat healthy, and achieve your
            wellness goals with NutriFit-Hub.
          </p>
          <div className="mt-4">
            <Link to="/dashboard" className="btn btn-primary me-3 px-4 py-2">
              Get Started
            </Link>
            <Link to="/about" className="btn btn-outline-secondary px-4 py-2">
              Learn More
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
